import React, { useState } from 'react';
import './Sidebar.css';

const Sidebar = () => {
  const [selectedItem, setSelectedItem] = useState<string>('Home');

  const handleSelect = (item: string) => {
    setSelectedItem(item);
  };

  return (
    <div className="sidebar">
      <h2>Menu</h2>
      <ul>
        <li>
          <a
            href="#"
            className={selectedItem === 'Home' ? 'selected' : ''}
            onClick={() => handleSelect('Home')}
          >
            Home
          </a>
        </li>
        <li>
          <a
            href="#"
            className={selectedItem === 'Training Data' ? 'selected' : ''}
            onClick={() => handleSelect('Training Data')}
          >
            Training Data
          </a>
        </li>
        <li>
          <a
            href="#"
            className={selectedItem === 'Evaluation Data' ? 'selected' : ''}
            onClick={() => handleSelect('Evaluation Data')}
          >
            Evaluation Data
          </a>
        </li>
        <li>
          <a
            href="#"
            className={selectedItem === 'About the Models' ? 'selected' : ''}
            onClick={() => handleSelect('About the Models')}
          >
            About the Models
          </a>
        </li>
        <li>
          <a
            href="#"
            className={selectedItem === 'Data Usage and Privacy' ? 'selected' : ''}
            onClick={() => handleSelect('Data Usage and Privacy')}
          >
            Data Usage and Privacy
          </a>
        </li>
        <li>
          <a
            href="#"
            className={selectedItem === 'Meet the Team' ? 'selected' : ''}
            onClick={() => handleSelect('Meet the Team')}
          >
            Meet the Team
          </a>
        </li>
      </ul>
    </div>
  );
};

export default Sidebar;
